Jerry Lee Lewis (born September 29, 1935) is an American rock and roll and country music singer and pianist. An early pioneer of rock and roll music, Lewis was inducted into the Rock and Roll Hall of Fame in 1986 and his pioneering contribution to the genre has been recognized by the Rockabilly Hall of Fame. In 2004, Rolling Stone Magazine ranked him number 24 on their list of the 100 Greatest Artists of All Time. In 2003, they listed his box set All Killer, No Filler: The Anthology number 242 on their list of &quot;500 greatest albums of all time&quot;.

